/****************************************************************************
 * Function Name  :proto_register_iprDissector
 * Inputs         :None
 * Outputs        : 
 * Returns        :None 
 * Variables      : 
 * Description    :This function registers the given protocol.
 ****************************************************************************/

void proto_register_iprDissector (void)
{
   if (proto_iprDissector == -1) 
   {
        proto_iprDissector = proto_register_protocol("lte_iprDissector", "LTEIPRDISSECTOR", "ipr_dissector");
 
        proto_register_field_array (proto_iprDissector, hf, array_length(hf));

        proto_register_subtree_array (ett, array_length (ett));

        register_dissector("ipr_dissector", dissect_ipr, proto_iprDissector);
   } 
}





